import React, { useState } from 'react';

const FormComponent = () => {
  const [formData, setFormData] = useState({
    companyName: '',
    ownerName: '',
    rollno: '',
    ownerEmail: '',
    accessCode: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log(formData);

    setFormData({
      companyName: '',
      ownerName: '',
      rollno: '',
      ownerEmail: '',
      accessCode: '',
    });
  };
  const obtainAuthorizationToken = async () => {
    const url = 'http://104.211.219.98/train/auth';
    const data = {
      companyName: '',
      clientID: '',
      ownerName: '',
      ownerEmail: '',
      rollNo: 1,
      clientSecret: 'XoyalDRPayBODAN'
    };

    try {
      const response = await fetch(url, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(data)
      });

      if (response.ok) {
        const result = await response.json();
        console.log(result);
        // Obtain the authorization token and handle further actions
      } else {
        console.log('Authorization failed:', response.status);
      }
    } catch (error) {
      console.error('Error:', error);
    }
  };

  obtainAuthorizationToken();

  return (
    <form onSubmit={handleSubmit}>
      <div className="form-group">
        <label htmlFor="companyName">Company Name</label>
        <input
          type="text"
          className="form-control"
          id="companyName"
          name="companyName"
          value={formData.companyName}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label htmlFor="ownerName">Owner Name</label>
        <input
          type="text"
          className="form-control"
          id="ownerName"
          name="ownerName"
          value={formData.ownerName}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label htmlFor="rollno">Roll No</label>
        <input
          type="text"
          className="form-control"
          id="rollno"
          name="rollno"
          value={formData.rollno}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label htmlFor="ownerEmail">Owner Email</label>
        <input
          type="email"
          className="form-control"
          id="ownerEmail"
          name="ownerEmail"
          value={formData.ownerEmail}
          onChange={handleChange}
          required
        />
      </div>

      <div className="form-group">
        <label htmlFor="accessCode">Access Code</label>
        <input
          type="text"
          className="form-control"
          id="accessCode"
          name="accessCode"
          value={formData.accessCode}
          onChange={handleChange}
          required
        />
      </div>

      <button type="submit" className="btn btn-primary">
        Submit
      </button>
    </form>
  );
};

export default FormComponent;
